#include <iostream>
#include <future>
#include <benchmark/benchmark.h>
#include <chowdsp_data_structures/chowdsp_data_structures.h>

struct String_List_Node
{
    std::string_view str;
    String_List_Node* next = nullptr;
};

struct String_List
{
    String_List_Node* head = nullptr;
    String_List_Node* tail = nullptr;
};

static void append_list (chowdsp::ChainedArenaAllocator& arena, String_List& ll, std::string_view str)
{
    auto* new_node = arena.allocate<String_List_Node> (1);
    new_node->str = str;
    new_node->next = nullptr;

    if (ll.head == nullptr)
        ll.head = new_node;

    if (ll.tail != nullptr)
        ll.tail->next = new_node;

    ll.tail = new_node;
}

static bool is_char (char c)
{
    return (c >= 'a' && c <= 'z') || (c >= 'A' && c <= 'Z');
}

static void find_ls (chowdsp::ChainedArenaAllocator& arena, String_List& string_list, std::string_view str)
{
    size_t word_start_idx = 0;
    for (size_t idx = 1; idx < str.size(); ++idx)
    {
        if (! is_char (str[idx]))
        {
            if (idx - word_start_idx > 1 && (str[word_start_idx] == 'l' || str[word_start_idx] == 'L'))
            {
                const auto substr = str.substr (word_start_idx, idx - word_start_idx);
                append_list (arena, string_list, substr);
            }
            word_start_idx = idx + 1;
        }
    }
}

static void scan_single_thread (benchmark::State& state)
{
    chowdsp::ChainedArenaAllocator arena { 8192 };
    String_List string_list;

    for (auto _ : state)
    {
        find_ls (arena, string_list, lorem_ipsum);
        int count = 0;
        for (auto* node = string_list.head; node != nullptr; node = node->next)
            count++;
        benchmark::DoNotOptimize (count);
    }
}
BENCHMARK (scan_single_thread)->UseRealTime();

static void scan_multi_thread (benchmark::State& state)
{
    static constexpr size_t thread_count = 8;

    struct Result
    {
        chowdsp::ChainedArenaAllocator arena;
        String_List string_list;
    };

    for (auto _ : state)
    {
        std::array<std::future<Result>, thread_count> results {};

        const auto chunk_size = lorem_ipsum.size() / thread_count;
        for (size_t i = 0; i < thread_count; ++i)
        {
            const auto substr = lorem_ipsum.substr (i * chunk_size,
                                                    i == (thread_count - 1) ? std::string_view::npos : chunk_size);
            results[i] = std::async (std::launch::async, [substr]
                                     {
            Result r;
            r.arena.reset (8192);
            find_ls (r.arena, r.string_list, substr);
            return r; });
        }

        chowdsp::ChainedArenaAllocator concat_arena {};
        String_List concat_string_list;
        for (auto& f : results)
        {
            auto result = f.get();
            concat_arena.merge (result.arena);
            if (concat_string_list.head == nullptr)
                concat_string_list.head = result.string_list.head;
            if (concat_string_list.tail != nullptr)
                concat_string_list.tail->next = result.string_list.head;
            concat_string_list.tail = result.string_list.tail;
        }
    }
}
BENCHMARK (scan_multi_thread)->UseRealTime();

BENCHMARK_MAIN();
